function GetRainbowTexture(){
    var textureColors = [
        [0, 0, 0],
        [13, 0, 254],
        [14, 38, 252],
        [0, 55, 255],
        [1, 96, 226],
        [3, 157, 137],
        [12, 226, 54],
        [17, 255, 15],
        [109, 254, 6],
        [219, 255, 3],
        [255, 227, 8],
        // [253, 93, 24],
        // [253, 93, 24],
        // [241, 93, 36],
        [253, 153, 24],
        [241, 93, 36],
        [239, 67, 38],
        [239, 51, 38],
        [239, 41, 38]
    ];
    heatmapTexture = new Uint8Array(16 * 2 * 3).fill(0);
    for (var i = 0; i < 16; i++) {
        heatmapTexture[3 * i] = textureColors[i][0];
        heatmapTexture[3 * i + 1] = textureColors[i][1];
        heatmapTexture[3 * i + 2] = textureColors[i][2];
        heatmapTexture[3 * (i + 16)] = textureColors[i][0];
        heatmapTexture[3 * (i + 16) + 1] = textureColors[i][1];
        heatmapTexture[3 * (i + 16) + 2] = textureColors[i][2];
    }
    heatmapTexture = new THREE.DataTexture(heatmapTexture, 16, 2, THREE.RGBFormat);
    heatmapTexture.minFilter = THREE.LinearFilter;
    heatmapTexture.magFilter = THREE.LinearFilter;
    heatmapTexture.needsUpdate = true;
    return heatmapTexture;
}

THREE.VadrObjectShader = function(depthTest) {
    this.uniforms = {
        "lowerBound": {
            type: "v3",
            value: new THREE.Vector3(0, 0, 0)
        },
        "conversionFactor": {
            type: "v3",
            value: new THREE.Vector3(0, 0, 0)
        },
        "hashmaptextureLow": {
            value: null
        },
        "hashmaptextureHigh": {
            value: null
        },
        "boxDataTextureLow": {
            value: null
        },
        "boxDataTextureHigh": {
            value: null
        },
        "heatmapTexture": {
            value: GetRainbowTexture()
        },
        "textureValid": { value: 0 },
        "boxScale": { value: 1 },
        "textureDimension": { value: textureDimension }
    };
    this.vertexShader = [
        "precision mediump float;",
        "precision mediump int;",

        "uniform mat4 modelViewMatrix;",
        "uniform mat4 projectionMatrix;",
        "uniform float boxScale;",
        "uniform vec3 lowerBound;",

        "attribute vec3 position;",
        "varying vec3 f_position_scaled;",
        "varying vec3 f_box;",

        "void main() {",
        "   vec4 sourcePos = projectionMatrix * modelViewMatrix * vec4(position.xyz, 1.0);",
        "   gl_Position = sourcePos;",
        "   f_position_scaled = vec3(((position.xyz - lowerBound) / boxScale - 0.5) / 255.);",
        "   f_box = vec3((position.xyz - lowerBound) / boxScale);",
        "}"
    ].join("\n");
    this.fragmentShader = `
    precision mediump float;
    precision mediump int;
    varying vec3 f_position_scaled;
    varying vec3 f_box;
    uniform int textureValid;
    uniform float textureDimension;
    uniform vec3 conversionFactor;
    uniform sampler2D heatmapTexture;
    uniform sampler2D hashmaptextureLow;
    uniform sampler2D hashmaptextureHigh;
    uniform sampler2D boxDataTextureHigh;
    uniform sampler2D boxDataTextureLow;

    vec4 getStartEndIndex(vec3 f_box_point, float i, float j){
        vec2 texelPosition = vec2(f_box_point.x + i + 2., f_box_point.z + j + 2.) / 512.;
        return 255. * (256. * texture2D(hashmaptextureHigh, texelPosition) + texture2D(hashmaptextureLow, texelPosition));
    }

    float getPointContribution(vec2 texPosition){
        vec4 tempPixelHigh = texture2D(boxDataTextureHigh, texPosition);
        vec4 tempPixelLow = texture2D(boxDataTextureLow, texPosition);
        vec4 positionVertex = 256. * tempPixelHigh + tempPixelLow;
        float diffSquare = distance(positionVertex.xyz, f_position_scaled);
        return positionVertex.w * clamp(.009 - diffSquare, 0.0, 0.009) / .009;
    }

    void main(){
        if (textureValid == 0){
            gl_FragColor = vec4(.25, .25, .25, 1.);
        } else {
            float sumIntensity = 0.;
            const float jumpValue = 1. / 1024.;
            for (float i = -2.; i < 3.; i += 1.){
                for (float j = -2.; j < 3.; j += 1.){            
                    vec4 startEndPoints = getStartEndIndex(f_box, i, j);
                    startEndPoints = startEndPoints / 1024.;
                    float xAdd = startEndPoints.x;
                    float yAdd = startEndPoints.y;
                    for (int k = 0; k < 512; k++){
                        if ( xAdd <= startEndPoints.z && yAdd <= startEndPoints.w ){
                            sumIntensity = sumIntensity + getPointContribution(vec2(xAdd + jumpValue / 2., yAdd + jumpValue / 2.));
                            if (xAdd + jumpValue >= 1.){
                                yAdd = yAdd + jumpValue;
                                xAdd = 0.;
                            }else{
                                xAdd = xAdd + jumpValue;
                            }
                        }else{
                            break;
                        }
                    }
                }
            }
            vec2 colorTex = vec2(sumIntensity * .5, 0.5);
            gl_FragColor = texture2D(heatmapTexture, colorTex);
        }
    }
    `;
    this.depthTest = true;
    this.depthWrite = true;
    this.transparent = false;
    this.blending = THREE.CustomBlending;
    this.blendEquation = THREE.AddEquation;
    this.blendSrc = THREE.SrcAlphaFactor;
    this.blendDst = THREE.OneFactor;
    this.blendSrcAlpha = THREE.OneMinusDstAlphaFactor;
    this.blendDstAlpha = THREE.OneFactor;
    // this.side = THREE.DoubleSide;
}

