//converts the index into 3d coordinate (in data aggreagte box space)
function getBoxPointFromIndex(pointIndex, conversionFactors){
    var point = [ 0, 0, 0 ];
    point[0] = Math.floor(pointIndex / conversionFactors[0]);
    point[1] = pointIndex - point[0] * conversionFactors[0];
    point[2] = point[1] % conversionFactors[1];
    point[1] = Math.floor(point[1] / conversionFactors[1]);
    return point;
}


// converts an integer into 16 bits (2 values, 8 bit left and 8 bit right)
// returns [high8bits, low8bits]
function get2xUintValue(intengerValue){
    return [Math.floor(intengerValue / 256), intengerValue % 256];
}


// places a point (x, y) into an array of (512 * 512)
// shifts point to (x + 2, y + 2) before
// placement as such because when converted to texture, first x increases, then y
// treats x as low dim, 
function point2DToIndex(point){
    return 512 * (point[1] + 2) + point[0] + 2;
}

// converts an index to points [x, y] for the main data store texture
// treats x as low dim, return [x, y]
function indexToTexture2DPoint(index){
    return [index % textureDimension, parseInt(index / textureDimension)];
}


function sortPoints(points){
    for ( var i = 0; i < points.length - 1; i++ ){
        for ( var j = 0; j < points.length - 1; j++ ){

            if (points[j] > points[j+1]){
                var tempPoint = points[j];
                points[j] = points[j+1];
                points[j+1] = tempPoint;
            }

        }
    }
}

// uses x and z to create hash, y is the stored value
// did this because y being height will see minimum blocks, thus more useful hashing with x and z
function createHashmap(points, intensity){
    var pointsHashmap = {};
    for (var i = 0; i < points.length; i++){
        var tempPoint = [points[i][0], points[i][1], points[i][2], intensity[i]];
        if(tempPoint[0] > 512 || tempPoint[2] > 512)
            console.log("Points exceeding ", tempPoint);
        if (pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]] === undefined){
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]] = {};
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]]["base"] = [tempPoint[0], tempPoint[2]];
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]]["y"] = [tempPoint[1]];
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]]["intensity"] = [tempPoint[3]];
        }else{
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]]["y"].push(tempPoint[1]);
            pointsHashmap[tempPoint[0] * hashFactor + tempPoint[2]]["intensity"].push(tempPoint[3]);
        }
    }
    var hashKeys = Object.keys(pointsHashmap);
    for ( var i = 0; i < hashKeys.length; i++){

        sortPoints(pointsHashmap[hashKeys[i]]["y"]);
    
    }
    console.log(pointsHashmap);
    return pointsHashmap;
}


// encodes 3d position and intensity values in two textures of 32 bit width each
// higher 8 bits of XYZ get encoded 
// lower 8 bits of XYZ get encoded in textureLow.xyz
// the intensity is encoded in textureLow.w
function createDataTexture(pointsArray, intensityArray, maxIntensity, conversionFactors){
    if (pointsArray.length > textureDimension * textureDimension){
        console.log("Way too many points to handle, taking first textureDimension * textureDimension points");
    }

    // hashpoints store the start and end points on the main texture
    // .x - start.x, .y - start.y, .z - end.x, .z = end.y 
    var hashPointLowTexture = new Uint8Array(512 * 512 * 4).fill(0);
    var hashPointHighTexture = new Uint8Array(512 * 512 * 4).fill(0);
    var dataTextureLow = new Uint8Array(textureDimension * textureDimension * 4).fill(0);
    var dataTextureHigh = new Uint8Array(textureDimension * textureDimension * 4).fill(0);
    var points3DArray = [];

    for ( var i = 0; i < pointsArray.length; i++ ){
        intensityArray[i] = intensityArray[i] / maxIntensity;
        points3DArray.push(getBoxPointFromIndex(pointsArray[i], conversionFactors));
    }

    var pointsHashmap = createHashmap(points3DArray, intensityArray);
    console.log("Hashmap is ", pointsHashmap);
    var hashmapKeys = Object.keys(pointsHashmap);

    var texturePointIndex = 1;
    for ( var i = 0; i < hashmapKeys.length; i++ ){
        var basePoints = pointsHashmap[hashmapKeys[i]]["base"];
        var yPoints = pointsHashmap[hashmapKeys[i]]["y"];
        var intensityPoints = pointsHashmap[hashmapKeys[i]]["intensity"];
        var tempHashmapIndex = point2DToIndex(basePoints);
        console.log("tempIndex is ", tempHashmapIndex);
        // get 2d starting and ending point (X,Y) for hashed values belonging to current hash
        var startPoint = indexToTexture2DPoint(texturePointIndex);
        var endPoint = indexToTexture2DPoint(texturePointIndex + yPoints.length -1);
        // convert the start and end points to two 8 bit values so as two store in high and low textures
        startPoint = [get2xUintValue(startPoint[0]), get2xUintValue(startPoint[1])];
        endPoint = [get2xUintValue(endPoint[0]), get2xUintValue(endPoint[1])];

        if (hashmapKeys[i] == 17679){
            console.log("start and end are ", startPoint, endPoint);
        }

        hashPointLowTexture[tempHashmapIndex * 4] = startPoint[0][1];
        hashPointLowTexture[tempHashmapIndex * 4 + 1] = startPoint[1][1];
        hashPointLowTexture[tempHashmapIndex * 4 + 2] = endPoint[0][1];
        hashPointLowTexture[tempHashmapIndex * 4 + 3] = endPoint[1][1];
        hashPointHighTexture[tempHashmapIndex * 4] = startPoint[0][0];
        hashPointHighTexture[tempHashmapIndex * 4 + 1] = startPoint[1][0];
        hashPointHighTexture[tempHashmapIndex * 4 + 2] = endPoint[0][0];
        hashPointHighTexture[tempHashmapIndex * 4 + 3] = endPoint[1][0];

        for ( var j = 0; j < yPoints.length; j++ ){
            var tempPoint = [get2xUintValue(basePoints[0]), get2xUintValue(yPoints[j]), get2xUintValue(basePoints[1])];
            dataTextureLow[4 * texturePointIndex] = tempPoint[0][1];
            dataTextureLow[4 * texturePointIndex + 1] = tempPoint[1][1];
            dataTextureLow[4 * texturePointIndex + 2] = tempPoint[2][1];
            dataTextureLow[4 * texturePointIndex + 3] = intensityPoints[j] * 255;                
            dataTextureHigh[4 * texturePointIndex] = tempPoint[0][0];
            dataTextureHigh[4 * texturePointIndex + 1] = tempPoint[1][0];
            dataTextureHigh[4 * texturePointIndex + 2] = tempPoint[2][0];
            dataTextureHigh[4 * texturePointIndex + 3] = 0;
            texturePointIndex = texturePointIndex + 1;                
        }

    }

    // setting up textures for hashmap data
    hashPointLowTexture = new THREE.DataTexture(hashPointLowTexture, 512, 512, THREE.RGBAFormat);
    hashPointLowTexture.minFilter = THREE.NearestFilter;
    hashPointLowTexture.magFilter = THREE.NearestFilter;
    hashPointLowTexture.needsUpdate = true;
    hashPointHighTexture = new THREE.DataTexture(hashPointHighTexture, 512, 512, THREE.RGBAFormat);
    hashPointHighTexture.minFilter = THREE.NearestFilter;
    hashPointHighTexture.magFilter = THREE.NearestFilter;
    hashPointHighTexture.needsUpdate = true;
    console.log(hashPointLowTexture.image);

    // setting up textures for position and information data
    dataTextureLow = new THREE.DataTexture(dataTextureLow, textureDimension, textureDimension, THREE.RGBAFormat);
    dataTextureLow.minFilter = THREE.NearestFilter;
    dataTextureLow.magFilter = THREE.NearestFilter;
    dataTextureLow.needsUpdate = true;
    dataTextureHigh = new THREE.DataTexture(dataTextureHigh, textureDimension, textureDimension, THREE.RGBAFormat);
    dataTextureHigh.minFilter = THREE.NearestFilter;
    dataTextureHigh.magFilter = THREE.NearestFilter;
    dataTextureHigh.needsUpdate = true;
    console.log( "pointsHashmap: ", hashPointLowTexture.image, hashPointHighTexture.image);
    console.log("data textures are: ", dataTextureLow.image, dataTextureHigh.image);
    // console.log(dataTextureLow.image, dataTextureHigh.image);
    return [ dataTextureLow, dataTextureHigh, hashPointLowTexture, hashPointHighTexture ];
}

// Updates the data texture and other params on the heatmap material
function updateMaterial(materialObject, dataTexture){

    materialObject.hmDataTextureLow = dataTexture[0];
    materialObject.hmDataTextureHigh = dataTexture[1];
    materialObject.hmHashTextureLow = dataTexture[2];
    materialObject.hmHashTextureHigh = dataTexture[3];

    materialObject.generateHm = 1;
    materialObject.hmScale = unitBoxDim;
    materialObject.hmOffset = new THREE.Vector3(boundingBox[0], 
                                                    boundingBox[1], boundingBox[2]);

    materialObject.needsUpdate = true;

}

function enableHeatmap( enable ){

        if (modelMaterialArray !== undefined){
            
            for (var i = 0; i < modelMaterialArray.length; i++){

                modelMaterialArray[i].generateHm = enable;
                modelMaterialArray[i].needsUpdate = true;

            }

        }
}

